import React, {Component} from 'react';

class Header extends Component {
    render() {
        return (
            <>
                <div className="main__backround">


                    <header>
                        <nav>
                            <div className="nav__item">
                                <p><a href="#">JT</a></p>

                                <div className="launges">
                                    <p>ENG</p>
                                    <p><a href="">RUS</a></p>
                                </div>
                            </div>
                        </nav>

                        .
                    </header>

                </div>
            </>
        );
    }
}

export default Header;
